function Footer() {
  return (
    <div className="fixed-bottom">
      <footer className="" id="main-footer">
        <div className="row">
          <div className="col d-flex justify-content-center">
            <p>
              <span>&copy;</span>2023 William J. Burbridge Portfolio
            </p>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
